Dubai Award for Sustainable Transport (DAST)

Prisme International, an event agency working on events of the highest profile, commissioned us the creation of an animated piece for the Dubai Award for Sustainable Transport. This animated content would be played back during an award ceremony on a massive screen (30m x 6m) and rendered at 5K. 
The concept behind this content was clear, but creatively speaking, we had no brief and 3 weeks to deliver.
Although the pressure was extremely high, this was definitely one of the most enjoyable and rewarding projects we have worked on recently. 

Keep 'em coming!

